// El resto del script de index.html irá debajo de esto
// js/index-script.js (continuación)

document.addEventListener('DOMContentLoaded', () => {
    const searchInput = document.getElementById('search-input');
    const searchResultsContainer = document.getElementById('search-results');
    const selectionSection = document.getElementById('selection-section');
    const selectedCompanyNameEl = document.getElementById('selected-company-name');
    const yearSelect = document.getElementById('year-select');
    const quarterSelect = document.getElementById('quarter-select');
    const typeSelect = document.getElementById('type-select');
    const viewTranscriptBtn = document.getElementById('view-transcript-btn');
    const breadcrumbsEl = document.getElementById('breadcrumbs');
    const loadingIndicator = document.getElementById('loading-indicator');

    let currentSelection = {
        ticker: null,
        year: null,
        quarter: null,
        type: null
    };

    function updateBreadcrumbs() {
        let html = '<span><a href="#" data-level="home">Home</a></span>';
        if (currentSelection.ticker) {
            const companyName = empresasData[currentSelection.ticker].nombre;
            html += ` > <span><a href="#" data-level="company">${companyName} (${currentSelection.ticker})</a></span>`;
        }
        if (currentSelection.year) {
            html += ` > <span><a href="#" data-level="year">${currentSelection.year}</a></span>`;
        }
        if (currentSelection.quarter) {
            html += ` > <span><a href="#" data-level="quarter">${currentSelection.quarter}</a></span>`;
        }
        if (currentSelection.type) {
            let typeText = currentSelection.type === 'completa' ? 'Transcripción Completa' : 'Resumen';
            html += ` > <span class="current-step">${typeText}</span>`;
        }
        breadcrumbsEl.innerHTML = html;

        // Add event listeners to breadcrumb links
        breadcrumbsEl.querySelectorAll('a').forEach(link => {
            link.addEventListener('click', (e) => {
                e.preventDefault();
                const level = e.target.dataset.level;
                handleBreadcrumbClick(level);
            });
        });
    }
    
    function handleBreadcrumbClick(level) {
        switch(level) {
            case 'home':
                resetSelections();
                searchInput.value = '';
                displaySearchResults('');
                selectionSection.style.display = 'none';
                break;
            case 'company':
                currentSelection.year = null;
                currentSelection.quarter = null;
                currentSelection.type = null;
                populateYearSelect(currentSelection.ticker);
                quarterSelect.disabled = true;
                quarterSelect.innerHTML = '<option value="">Seleccione un trimestre</option>';
                typeSelect.disabled = true;
                typeSelect.innerHTML = '<option value="">Seleccione un tipo</option>';
                viewTranscriptBtn.disabled = true;
                break;
            case 'year':
                currentSelection.quarter = null;
                currentSelection.type = null;
                populateQuarterSelect(currentSelection.ticker, currentSelection.year);
                typeSelect.disabled = true;
                typeSelect.innerHTML = '<option value="">Seleccione un tipo</option>';
                viewTranscriptBtn.disabled = true;
                break;
            case 'quarter': // No tiene sentido un link a quarter, ya que type es el siguiente paso
                currentSelection.type = null;
                populateTypeSelect(currentSelection.ticker, currentSelection.year, currentSelection.quarter);
                viewTranscriptBtn.disabled = true;
                break;
        }
        updateBreadcrumbs();
    }


    function resetSelections() {
        currentSelection = { ticker: null, year: null, quarter: null, type: null };
        selectedCompanyNameEl.textContent = '';
        selectionSection.style.display = 'none';
        clearAndDisableSelect(yearSelect, "Seleccione un año");
        clearAndDisableSelect(quarterSelect, "Seleccione un trimestre");
        clearAndDisableSelect(typeSelect, "Seleccione un tipo");
        viewTranscriptBtn.disabled = true;
        updateBreadcrumbs();
    }

    function clearAndDisableSelect(selectElement, defaultOptionText) {
        selectElement.innerHTML = `<option value="">${defaultOptionText}</option>`;
        selectElement.disabled = true;
    }

    function populateSelectWithOptions(selectElement, options, defaultOptionText) {
        selectElement.innerHTML = `<option value="">${defaultOptionText}</option>`;
        options.forEach(option => {
            const opt = document.createElement('option');
            opt.value = option;
            opt.textContent = option;
            selectElement.appendChild(opt);
        });
        selectElement.disabled = false;
    }
    
    function displaySearchResults(query) {
        searchResultsContainer.innerHTML = ''; // Limpiar resultados anteriores
        if (!query.trim()) {
            searchResultsContainer.style.display = 'none';
            return;
        }

        const lowerCaseQuery = query.toLowerCase();
        const results = Object.keys(empresasData).filter(ticker => {
            const empresa = empresasData[ticker];
            return ticker.toLowerCase().includes(lowerCaseQuery) || empresa.nombre.toLowerCase().includes(lowerCaseQuery);
        });

        if (results.length > 0) {
            results.forEach(ticker => {
                const empresa = empresasData[ticker];
                const item = document.createElement('div');
                item.classList.add('search-result-item');
                item.innerHTML = `
                    <span>${empresa.nombre} (${ticker})</span>
                    <button data-ticker="${ticker}">Seleccionar</button>
                `;
                item.querySelector('button').addEventListener('click', () => {
                    handleCompanySelection(ticker);
                    searchResultsContainer.style.display = 'none'; // Ocultar resultados
                    searchInput.value = `${empresa.nombre} (${ticker})`; // Opcional: rellenar input
                });
                searchResultsContainer.appendChild(item);
            });
            searchResultsContainer.style.display = 'block';
        } else {
            searchResultsContainer.innerHTML = '<p class="no-results">No se encontraron empresas.</p>';
            searchResultsContainer.style.display = 'block';
        }
    }


    searchInput.addEventListener('input', (e) => {
        displaySearchResults(e.target.value);
    });
    
    // Ocultar resultados si se hace clic fuera del input y los resultados
    document.addEventListener('click', function(event) {
        if (!searchInput.contains(event.target) && !searchResultsContainer.contains(event.target)) {
            searchResultsContainer.style.display = 'none';
        }
    });


    function handleCompanySelection(ticker) {
        resetSelections(); // Resetea todo menos el ticker actual
        currentSelection.ticker = ticker;
        const empresa = empresasData[ticker];
        selectedCompanyNameEl.textContent = `Empresa Seleccionada: ${empresa.nombre} (${ticker})`;
        selectionSection.style.display = 'block';
        
        populateYearSelect(ticker);
        clearAndDisableSelect(quarterSelect, "Seleccione un trimestre");
        clearAndDisableSelect(typeSelect, "Seleccione un tipo");
        viewTranscriptBtn.disabled = true;
        updateBreadcrumbs();
    }

    function populateYearSelect(ticker) {
        const empresa = empresasData[ticker];
        if (empresa && empresa.transcripciones) {
            const years = Object.keys(empresa.transcripciones).sort((a,b) => b - a); // Ordenar descendente
            populateSelectWithOptions(yearSelect, years, "Seleccione un año");
        } else {
            clearAndDisableSelect(yearSelect, "No hay datos de años");
        }
    }

    yearSelect.addEventListener('change', (e) => {
        currentSelection.year = e.target.value;
        currentSelection.quarter = null;
        currentSelection.type = null;
        if (currentSelection.year) {
            populateQuarterSelect(currentSelection.ticker, currentSelection.year);
        } else {
            clearAndDisableSelect(quarterSelect, "Seleccione un trimestre");
        }
        clearAndDisableSelect(typeSelect, "Seleccione un tipo");
        viewTranscriptBtn.disabled = true;
        updateBreadcrumbs();
    });

    function populateQuarterSelect(ticker, year) {
        const empresa = empresasData[ticker];
        if (empresa && empresa.transcripciones[year]) {
            const quarters = Object.keys(empresa.transcripciones[year]).sort(); // Q1, Q2, Q3, Q4
            populateSelectWithOptions(quarterSelect, quarters, "Seleccione un trimestre");
        } else {
            clearAndDisableSelect(quarterSelect, "No hay datos de trimestres");
        }
    }

    quarterSelect.addEventListener('change', (e) => {
        currentSelection.quarter = e.target.value;
        currentSelection.type = null;
        if (currentSelection.quarter) {
            populateTypeSelect(currentSelection.ticker, currentSelection.year, currentSelection.quarter);
        } else {
            clearAndDisableSelect(typeSelect, "Seleccione un tipo");
        }
        viewTranscriptBtn.disabled = true;
        updateBreadcrumbs();
    });

    function populateTypeSelect(ticker, year, quarter) {
        const empresa = empresasData[ticker];
        if (empresa && empresa.transcripciones[year] && empresa.transcripciones[year][quarter]) {
            const typesAvailable = empresa.transcripciones[year][quarter];
            let options = [];
            if (typesAvailable.completa) options.push({value: "completa", text: "Transcripción Completa"});
            if (typesAvailable.resumen) options.push({value: "resumen", text: "Resumen de Transcripción"});
            
            typeSelect.innerHTML = '<option value="">Seleccione un tipo</option>';
            options.forEach(option => {
                const opt = document.createElement('option');
                opt.value = option.value;
                opt.textContent = option.text;
                typeSelect.appendChild(opt);
            });
            typeSelect.disabled = false;
        } else {
            clearAndDisableSelect(typeSelect, "No hay tipos disponibles");
        }
    }

    typeSelect.addEventListener('change', (e) => {
        currentSelection.type = e.target.value;
        viewTranscriptBtn.disabled = !currentSelection.type;
        updateBreadcrumbs();
    });

    viewTranscriptBtn.addEventListener('click', () => {
        if (currentSelection.ticker && currentSelection.year && currentSelection.quarter && currentSelection.type) {
            const url = `transcript.html?ticker=${currentSelection.ticker}&year=${currentSelection.year}&quarter=${currentSelection.quarter}&type=${currentSelection.type}`;
            window.location.href = url;
        } else {
            alert("Por favor, complete todas las selecciones.");
        }
    });

    // Inicializar breadcrumbs
    updateBreadcrumbs();
});